import React from "react";
import { Link } from "react-router-dom";

export function Navigation() {

    
    return (
        <nav className="h-16 flex items-center justify-between px-6 bg-gray-700 text-white">
          <span className="text-xl font-semibold">React-2023</span>
      
          <div className="space-x-4">
            <Link to="/" className="hover:text-gray-300 transition duration-300 ease-in-out">Products</Link>
            <Link to="/about" className="hover:text-gray-300 transition duration-300 ease-in-out">About</Link>
          </div>
        </nav>
      );
      
}
